function AboutButton() {
  return (
    <Button variant="primary" href="/about">
      About
    </Button>
  );
}

function App() {
  return (
    <div className="App">
      <header>
        <div>
          <Link to="/">Accueil</Link>
          <AboutButton />
        </div>
      </header>
      <main>
        <Routes>
          <Route path="/" element={<App />} />
          <Route path="about" element={<About />} />
        </Routes>
      </main>
    </div>
  );
}

export default App;
